import Timer from '../components/timer'
import CreateCustomRound from '../components/CreateCustomRound'
import RoundSelector from '../components/RoundSelector'
import Button from '../components/Button'
import rounds from '../src/rounds'

const HomePage = () => {

    function handleClick() {
        alert('Button clicked')
    }

    return (
        <div className='container'>
            <div className='side-bar'>
                <Button onClick={handleClick} text='USAC Modified Redpoint' />
                <Button text='3 Boulder Onsight' />
                <Button text='USAC Boulder Onsight' query='4BoulderOnsight'/>
                <Button text='USAC Regionals' />
                <Button text='IFSC Boulder Qualification' />
                <Button text='USAC Sport Local Onsight' />
                <Button text='USAC Sport Regionals' />
                <Button text='USAC Sport Divisionals' />
                <Button text='Custom Timer' />
            </div>
            <div className='round-settings'>

            </div>
        <style global jsx>{`
            body {
                background-color: black;
                margin: 0 auto;
            }
        `}</style>
        <style jsx>{`
            .container {
                display: flex;
                flex-wrap: wrap;
            }
            .side-bar {
                width: 20%;
                height: 100vh;
                background-color: white;
                display: flex;
                flex-direction: column;
                align-items: center;
            }
            .round-settings {
                display: flex;
                background-color: white;
                width: 80%;
                height: 100vh;
            }
        `}</style>
        </div>
    )
}

export default HomePage
